        <li className="navbar-item">
          <button className="navbar-buttons">Azure Commands</button> {/* Replaced "Services" with "Azure Commands" */}
        </li>
        <li className="navbar-item">
          <button className="navbar-buttons">Contact</button>
        </li>
      </ul>
    </div>
  </nav>
    );


  }

